import React, { Component } from 'react';
import '../../style/menu.css'

export default class Menu extends Component {
    render() {
        return (
            <div className="col-md-3 menu">
                <div className="menu_icon">
                    <i class="far fa-arrow-alt-circle-right" style={{ cursor: "pointer", fontSize: "28px"}}></i><span>Quản lý phòng</span>
                </div>

                <div className="menu_icon">
                    <i class="far fa-arrow-alt-circle-right" style={{ cursor: "pointer", fontSize: "28px"}}></i><span>Quản lý phòng</span>
                </div>

                <div className="menu_icon">
                    <i class="far fa-arrow-alt-circle-right" style={{ cursor: "pointer", fontSize: "28px"}}></i><span>Quản lý sinh viên</span>
                </div>

                <div className="menu_icon">
                    <i class="far fa-arrow-alt-circle-right" style={{ cursor: "pointer", fontSize: "28px"}}></i><span>Quản lý điện nước</span>
                </div>

                <div className="menu_icon">
                    <i class="far fa-arrow-alt-circle-right" style={{ cursor: "pointer", fontSize: "28px"}}></i><span>Quản lý thu chi</span>
                </div>
            </div>
        );
    }
}
